	<style type="text/css">
		.imageRotate
		{

			-webkit-transform-origin: 473.915px 284.869px;
			-moz-transform-origin: 473.915px 284.869px;
			-o-transform-origin: 473.915px 284.869px;
			transform-origin: 473.915px 284.869px;

			-webkit-animation: spin1 5s infinite linear;
			-moz-animation: spin1 5s infinite linear;
			-o-animation: spin1 5s infinite linear;
			-ms-animation: spin1 5s infinite linear;
			animation: spin1 5s infinite linear;
		}
		 
		@-webkit-keyframes spin1 {
			0% { -webkit-transform: rotate(0deg);}
			50% { -webkit-transform: rotate(-33.4deg);}
			100% { -webkit-transform: rotate(0deg);}

		}
		@-moz-keyframes spin1 {
			0% { -webkit-transform: rotate(0deg);}
			50% { -webkit-transform: rotate(-33.4deg);}
			100% { -webkit-transform: rotate(0deg);}
		}
		@-o-keyframes spin1 {
			0% { -webkit-transform: rotate(0deg);}
			50% { -webkit-transform: rotate(-33.4deg);}
			100% { -webkit-transform: rotate(0deg);}
		}
		@-ms-keyframes spin1 {
			0% { -webkit-transform: rotate(0deg);}
			50% { -webkit-transform: rotate(-33.4deg);}
			100% { -webkit-transform: rotate(0deg);}
		}
		@-keyframes spin1 {
			0% { -webkit-transform: rotate(0deg);}
			50% { -webkit-transform: rotate(-33.4deg);}
			100% { -webkit-transform: rotate(0deg);}
		} 
		.imageRotateRev
		{

			-webkit-transform-origin: 473.915px 284.869px;
			-moz-transform-origin: 473.915px 284.869px;
			-o-transform-origin: 473.915px 284.869px;
			transform-origin: 473.915px 284.869px;

			-webkit-animation: spin2 10s infinite linear;
			-moz-animation: spin2 10s infinite linear;
			-o-animation: spin2 10s infinite linear;
			-ms-animation: spin2 10s infinite linear;
			animation: spin2 10s infinite linear;
		}
		 
		@-webkit-keyframes spin2 {
			0% { -webkit-transform: rotate(10deg);}
			50% { -webkit-transform: rotate(-10deg);}
			100% { -webkit-transform: rotate(10deg);}

		}
		@-moz-keyframes spin2 {
			0% { -moz-transform: rotate(10deg);}
			50% { -moz-transform: rotate(-10deg);}
			100% { -moz-transform: rotate(10deg);}
		}
		@-o-keyframes spin2 {
			0% { -o-transform: rotate(10deg);}
			50% { -o-transform: rotate(-10deg);}
			100% { -o-transform: rotate(10deg);}
		}
		@-ms-keyframes spin2 {
			0% { -ms-transform: rotate(10deg);}
			50% { -ms-transform: rotate(-10deg);}
			100% { -ms-transform: rotate(10deg);}
		}
		@-keyframes spin2 {
			0% { transform: rotate(10deg);}
			50% { transform: rotate(-10deg);}
			100% { transform: rotate(10deg);}
		}
